import React from "react";

const Profile = () => {
    return (
        <>
            <div class="card">
                    <div class="container">
                        <h4><b>Jane Doe</b></h4>
                        <p>Interior Designer</p>
                    </div>
            </div>
        </>
    );
};

export default Profile;
